-- Seed simple: 1000 platillos y sus ingredientes (solo INSERT VALUES; sin SELECT)
CREATE TABLE IF NOT EXISTS public.seed_platillo (
  name varchar(255) PRIMARY KEY,
  description varchar(255)
);
CREATE TABLE IF NOT EXISTS public.seed_platillo_ingrediente (
  id bigserial PRIMARY KEY,
  platillo_name varchar(255) NOT NULL REFERENCES public.seed_platillo(name) ON DELETE CASCADE,
  alimento_id bigint NOT NULL,
  peso_neto integer NOT NULL,
  orden integer NOT NULL DEFAULT 1
);
ON CONFLICT (name) DO NOTHING;
